import React from 'react'
import SkillData from './skillData'
import ToolData from './toolData'

function Skills() {

    return (
        <div>
            <h1>Skills</h1>
            <h2>Programming: 
                {SkillData.map((item, index) => {
                return(
                    <p key={index} className={item.cSkill}>
                        <img src={item.img}/>
                        {item.subject}
                    </p>
                )
            })}</h2>
            <h2>Mobile: 
                {ToolData.map((item, index) => {
                    return(
                        <p key={index} className={item.cTool}>
                            <img src={item.img}/>
                            {item.title}
                        </p>
                    )
                })}
            </h2>
            <h2>Design:</h2>
        </div>
    )
}

export default Skills
